import React, { Component } from "react";
import PhoneModel  from "./Phonemodel/Phonemodel";
import styles from './PhoneModels.module.css';
import Toolbar from "../../../Toolbar/Toolbar";
import apple from '../../../../Assets/Images/iPhone.jpg';
import samsung from '../../../../Assets/Images/samsung.jpg';

const brand = {

    apple: ['iPhone 5','iPhone 4', 'iPhone 6', 'iPhone 7', 'iPhone 8', 'iPhone x', 'iPhone 11', 'iPhone 12', 'iPhone 6'
                , 'iPhone 13'],
    samsung: ['j5', 'a5', 'j6', 'a6', 'a9', 'a10', 's9', 's10'],
    htc: ['model1', 'model2', 'model3', 'model4', 'model5']
}

const pic = [apple, samsung];





class PhoneModels extends Component {    


    render () {

        const mobile = Object.keys(brand).map(item => {
            if (item === this.props.model) {
                return brand[item].map((igkey, index) => {
                    return <PhoneModel key={index} title={item} device={igkey} />
                })
            }
        })

        return (
            <div className={styles.Main}>
                <Toolbar />
                <div className={styles.Pic}>
                    <img src={pic.map(item => {
                        return item === this.props.model ? {item} : null
                    })} />
                </div>
                <div className={styles.Mobile}>
                    {mobile}
                </div>
            </div>
        )
    }


}



export default PhoneModels;
